            lat: data[1].data.features[0].geometry.coordinates[1]
        })

    }
    const clickHandler1 = ()=>{
        console.log(originLatLan)
        console.log(destinationLatLan)
        console.log(result)
    }
    const clickHandler2 = ()=>{
     dispatch(getItinerary())
    }
    console.log(typeof(new Date().toISOString().slice(0, 10)))
    return (
        <div>
            <button onClick={clickHandler}>finde</button>
            <button onClick={clickHandler1}>log</button>
            <button onClick={clickHandler2}>fetch graphql</button>

        </div>
    )
}

export default TimetableScreen
